(20, 'page_sk', '<p><strong>Kebijakan Privasi Pasartopup melindungi penggunaan data dan informasi penting pengguna situs Pasartopup. Data dan informasi yang dikumpulkan pada saat melakukan pendaftaran, mengakses dan menggunakan layanan di Pasartopup , seperti email, nomor telepon, password dan lain-lain akan dilindungi oleh kebijakan privasi dari Jasatopupdiamond.<br />\r\nKebijakan-kebijakan tersebut adalah:</strong></p>\r\n\r\n<p><strong>- 1. Dengan mendaftar atau telah terdaftar otomatis anda telah menyetujui ketentuan layanan Pasartopup.<br />\r\n- 2. Saldo pada Pasartopup tidak dapat di tarik, ke bank, pulsa, maupun ke e-wallet anda.<br />\r\n- 3. Pasartopup berhak memblokir akun bila terdapat malakukan perbuatan yang dapat merugikan kami seperti hacking.<br />\r\n- 4. Pasartopup tidak bertanggung jawab atas kehilangan akun anda.<br />\r\n- 5. Harga layanan kami dapat berubah sewaktu-waktu tanpa pemberitahuan anda.<br />\r\n- 6. Jika sudah di transfer atau sudah di proses tidak bisa di batalkan atau di refund.<br />\r\n- 7. Pasartopup tidak menjamin keamanan akun anda.<br />\r\n- 8. Kesalahan Penulisan Format bukan Tanggung Jawab Kami.</strong></p>\r\n'),
